/*

COLORS

*/

:root {
    --main-dark-color: #222;
    --main-light-color: #fff;
    --main-background-color: #f5f5f6;    

    /* Gray */
    --main-gray-color: #757575;
    --light-gray-color:  #d5d5d5;
    --dark-gray-color:  #494949;

    /* Primary */
    --main-brand-color: #087f23;
    --light-brand-color: #4caf50;
    --dark-brand-color: #005100;

    /* Accent */
    --main-accent-color: #673AB7;
    --light-accent-color: #9a67ea;
    --dark-accent-color: #320b86;
}

/*

FONTS

*/

@import url('https://fonts.googleapis.com/css?family=Montserrat|Roboto');

/*

BASE ELEMENTS

*/

* {
    box-sizing: border-box;
    font-family: 'Montserrat', sans-serif
}

html {
    font-size: 16px;
}

html, body {
    height: 100%;
    width: 100%;
    min-height: 100vh;
    min-width: 100vw;
    margin: 0;    
}

h1, h2, h3, h4, h5, h6, caption, figcaption {
    font-family: 'Roboto', sans-serif;
}
